		"text": "Q : 담배 끊기 힘들지 않으셨는지.\nA : 미쓰백 안에서 상아한테 담배가 어떤 의미인지 알고있고 배역때문에 핀것이지 실제로는 어지럽고 힘들어서 끊기가 힘들지 않았다! \n김감독님 : 아직까지도 여배우가 담배를 피는게 화제가 되는\n🐰 : 그러니까요ㅋㅋ\n김감독님 : 나라에서 우리가 살고있군요.. https://t.co/TncuU6ywZ8"
